import json
import random

import requests

def aes_decrypt(response: bytes) -> str:
    # 设置密钥
    from Crypto.Cipher import AES
    from Crypto.Util.Padding import unpad
    key = b'e82ckenh8dichen8'  # 在ECB模式下，加密和解密时都使用相同的密钥

    # 初始化AES解密器
    decipher = AES.new(key, AES.MODE_ECB)

    # 解密数据
    plain_text = unpad(decipher.decrypt(response), AES.block_size)

    return plain_text.decode('utf-8')
def sign_data(cookies,headers):
    import requests
    data = {
        'params': '',
    }
    response = requests.post(
        'https://interface.music.163.com/eapi/pointmall/sign/calendar',
        cookies=cookies,
        headers=headers,
        data=data,
    )
    count = 0
    data = aes_decrypt(response.content)
    print(data)
    a = json.loads(data)['data']['signStr']
    for i in a:
        # 计算a中有多少个1
        if i == '1':
            count += 1
    return count
# 随机生成颜色
def get_random_color():
    return "#{:02x}{:02x}{:02x}".format(random.randint(0, 255), random.randint(0, 255), random.randint(0, 255))

# 生成 HTML 内容
def generate_html(text):

    colored_text = ""

    # 为每个字符生成随机颜色
    for char in text:
        color = get_random_color()
        colored_text += f'<span style="color:{color};">{char}</span>'
    return colored_text
